	{ project: 'JonSnow Clicky Game', GitHub: 'https://github.com/jerpowel321/JonSnow-ClickyGame' , Deployed: 'https://jerpowel321.github.io/JonSnow-ClickyGame/' ,Description: 'placeholder', Technologies: 'html, css, javascript' },
	{ project: 'Books App', GitHub: 'https://github.com/jerpowel321/books-app', Deployed: 'https://amazingbookstore.herokuapp.com/' , Description: 'placeholder', Technologies: 'html, css, javascript' },
	{ project: 'Eat-Da-Pizza', GitHub: 'https://github.com/jerpowel321/Pizza' , Deployed: 'https://eatdapizza321.herokuapp.com/', Description: 'placeholder', Technologies: 'html, css, javascript' },
	{ project: 'Vacation Finder', GitHub: 'https://github.com/jerpowel321/Friend-Finder', Deployed: 'https://vacationfinder.herokuapp.com/', Description: 'placeholder', Technologies: 'html, css, javascript' },
	{ project: 'Bamazon', GitHub: 'https://github.com/jerpowel321/Bamazon', Description: 'placeholder', Technologies: 'html, css, javascript' },
	{ project: 'Liri', GitHub: 'https://github.com/jerpowel321/liri-node-app', Description: 'placeholder', Technologies: 'html, css, javascript' },
	{ project: 'Train Scheduler', GitHub: 'https://github.com/jerpowel321/Train-Scheduler', Deployed: 'https://jerpowel321.github.io/Train-Scheduler/', Description: 'placeholder', Technologies: 'html, css, javascript' },
	{ project: 'GifTastic', GitHub: 'https://github.com/jerpowel321/GifTastic', Deployed: 'https://jerpowel321.github.io/GifTastic/', Description: 'placeholder', Technologies: 'html, css, javascript' },
	{ project: 'Trivia Game', GitHub: 'https://github.com/jerpowel321/TriviaGame', Deployed: 'https://jerpowel321.github.io/TriviaGame/', Description: 'placeholder', Technologies: 'html, css, javascript' }
